export default function Test() {
  let { title } = useParams();
  useEffect(()=>{
    ((async()=>{
      console.log(title)
    })())
  },[])
  return (
      <>
       <Navbar/>
        {
          <h1>{title}</h1>
        }
        <Footer/>
      </>
  )
}
